import numpy as np
import matplotlib.pyplot as plt
from skimage.color import rgb2gray

def spim2rgb(spectral_image, spim_wavelengths, lsource='D65'):
    """
    Calculate RGB image representation from a reflectance spectral image.
    
    RGB = spim2rgb(spectral_image, spim_wavelengths, lsource='D65')
    
    
    INPUTS:     spectral_image = Reflectance spectral image (3-D data cube)
    
                spim_wavelengths = Wavelengths of the spectral bands of the 
                                   reflectance spectral image.
                
                lsource = (optional) Light source to be used.
                          Can be a CIE standard illuminant ('A', 'D65', etc.), 
                          or a custom light source emission spectrum 
                          (the wavelengths must be the same as for the 
                           reflectance spectral image).

    OUTPUT:    RGB = RGB color image. 
    """
    
    spectralImage = spectral_image.copy()
    wavelengths = spim_wavelengths.copy()
    
    sizeSpim = spectralImage.shape
    if len(sizeSpim) == 1: # single spectrum
        sizeSpim = [1,1,sizeSpim[0]]
    elif len(sizeSpim) == 2: # 2-D matrix, spectra on columns
        sizeSpim = [1,sizeSpim[1],sizeSpim[0]]
    
    XYZ = spim2XYZ(spectralImage, wavelengths, lsource)
    
    RGB = XYZ2RGB(XYZ)
    
    return RGB


def spim2vec(spim):
    """
    Reshape a 3-D spectral data cube into a matrix. The vectors (spectra) are 
    on the columns of the matrix.
    
    vec = spim2vec(spim)
    
    INPUT:     spim = 3-D spectral data cube.
    
    
    OUTPUT:    vec = Matrix that contains vectors (spectra) of the spectral 
                     data cube on its columns. 
    """
    
    from numpy import reshape
    
    numOfRows, numOfCols, numOfBands = spim.shape
    
    vec = reshape(spim.copy(),(numOfRows*numOfCols, numOfBands))
    vec = vec.T # spectra on columns
    
    return vec


def spim2XYZ(spectral_image, spim_wavelengths, lsource='D65'):
    """
    Spectral reflectance image to CIE XYZ tristimulus values.
    
    INPUTS:     spectral_image = Reflectance spectral image (3-D data cube)
    
                spim_wavelengths = Wavelengths of the spectral bands of the 
                                   reflectance spectral image.
                
                lsource = (optional) Light source to be used.
                          Can be a CIE standard illuminant ('A', 'D65', etc.), 
                          or a custom light source emission spectrum 
                          (the wavelengths must be the same as for the 
                           reflectance spectral image).

    OUTPUT:     XYZ = CIE XYZ tristimulus values.
    """
    
    from numpy import interp, dot, array, reshape
    
    spectralImage = spectral_image.copy()
    wavelengths = spim_wavelengths.copy()
    
    sizeSpim = spectralImage.shape
    
    
    # If 'spectral_image' is not a 3-D data cube, then reshape into a cube:
    if spectralImage.ndim == 1: # a single reflectance spectrum
        spectralImage = spectralImage.reshape((1,1,sizeSpim[0]))
    elif spectralImage.ndim == 2: # 2-D matrix; spectra on columns
        spectralImage = spectralImage.T.reshape((1,sizeSpim[1],sizeSpim[0]))
    
    
    # Spectra must be in the usable wavelength range (360 - 830 nm):
    if wavelengths.min() < 380:
        indices = (wavelengths >= 380)
        spectralImage = spectralImage[:,:,indices]
        wavelengths = wavelengths[indices]
        if type(lsource) != str:
            lsource = lsource[indices]
    
    if wavelengths.max() > 780:
        indices = (wavelengths <= 780)
        spectralImage = spectralImage[:,:,indices]
        wavelengths = wavelengths[indices]
        if type(lsource) != str:
            lsource = lsource[indices]
    
    # CIE 1931 color-matching functions:
    CMFs = CIE_xyz_1931()
    
    sizeSpim = spectralImage.shape
    spectra = reshape(spectralImage,(sizeSpim[0]*sizeSpim[1],sizeSpim[2])).T
    
    if type(lsource) is str:
        
        # CIE standard light sources:
        lsources = CIE_light_sources()
        
        if lsource[0] == 'A': lcol = 1
        elif lsource[0] == 'B': lcol = 2
        elif lsource[0] == 'C': lcol = 3
        elif lsource == 'D65': lcol = 4
        elif lsource == 'D50': lcol = 5
        elif lsource == 'F2': lcol = 6
        elif lsource == 'F8': lcol = 7
        elif lsource == 'F11': lcol = 8
        elif lsource[0:1] == 'L1': lcol = 9
        elif lsource[0:1] == 'L2': lcol = 10
        elif lsource[0:1] == 'L3': lcol = 11
        else: lcol = 4
        
        light = interp(wavelengths, lsources[:,0], lsources[:,lcol])
        ciex  = interp(wavelengths, CMFs[:,0], CMFs[:,1])
        ciey  = interp(wavelengths, CMFs[:,0], CMFs[:,2])
        ciez  = interp(wavelengths, CMFs[:,0], CMFs[:,3])
        
    else:
        
        # Custom light source spectrum:
        light = lsource.copy()
        ciex = interp(wavelengths, CMFs[:,0], CMFs[:,1])
        ciey = interp(wavelengths, CMFs[:,0], CMFs[:,2])
        ciez = interp(wavelengths, CMFs[:,0], CMFs[:,3])
    
    
    # Normalization factor:
    k = 100.0/dot(ciey,light)
    
    # CIE XYZ tristimulus values:
    X = k * dot(ciex*light, spectra)
    Y = k * dot(ciey*light, spectra)
    Z = k * dot(ciez*light, spectra)
    
    # XYZ image:
    XYZ = array((X,Y,Z))
    # XYZ = reshape(XYZ.T,(sizeSpim[0],sizeSpim[1],3))
    
    return XYZ


def XYZ2Lab(XYZ, cie_iluminant='D65'):
    """
    CIE XYZ tristimulus values to CIE L*a*b* color coordinates.
    
    INPUTS:     XYZ = CIE XYZ tristimulus values.
    
                cie_illuminant = (optional) CIE white Light source. 
                                 Use of 'D65' is recommented.

    OUTPUT:     Lab = CIE L*a*b* color coordinates.
    """
    
    from numpy import arange, ones, stack
    
    # CIE XYZ coordinates:
    # X = XYZ[:,:,0]
    # Y = XYZ[:,:,1]
    # Z = XYZ[:,:,2]
    X = XYZ[0,:]
    Y = XYZ[1,:]
    Z = XYZ[2,:]
    
    # CIE XYZ tristimulus values for a perfectly reflecting diffuse sample, 
    # using a white light source (CIE standard illuminant), and the CIE 1931 
    # standard observer:
    wavelengths = arange(380,781,5)
    refl_perfect = ones((1,1,len(wavelengths)))
    XYZ_n = spim2XYZ(refl_perfect, wavelengths, cie_iluminant)
    XYZ_n = XYZ_n.squeeze()
    
    # Reference CIE XYZ coordinates:
    X_n = XYZ_n[0]
    Y_n = XYZ_n[1]
    Z_n = XYZ_n[2]
    
    # Ratios for calculations:
    ratio_X = X/X_n
    ratio_Y = Y/Y_n
    ratio_Z = Z/Z_n
    
    indices = (ratio_X <= 0.008856)
    f_X = ratio_X**(1/3)
    f_X[indices] = 7.787*ratio_X[indices] + 16/116
    
    indices = (ratio_Y <= 0.008856)
    f_Y = ratio_Y**(1/3)
    f_Y[indices] = 7.787*ratio_Y[indices] + 16/116
    
    indices = (ratio_Z <= 0.008856)
    f_Z = ratio_Z**(1/3)
    f_Z[indices] = 7.787*ratio_Z[indices] + 16/116
    
    L = 116*f_Y - 16
    a = 500*(f_X - f_Y)
    b = 200*(f_Y - f_Z)
    
    # Lab = stack((L,a,b), axis=2)
    Lab = np.row_stack((L,a,b))
        
    return Lab


def XYZ2RGB(XYZ):
    """
    CIE XYZ tristimulus values to RGB color coordinates.
    
    INPUT:      XYZ = CIE XYZ tristimulus values (3-D array).
    
    OUTPUT:     RGB = RGB color coordinates.
    """
    
    from numpy import dot, array, reshape
        
    M = array([[ 3.2406,-1.5372,-0.4986],
               [-0.9689, 1.8758, 0.0415],
               [ 0.0557,-0.2040, 1.0570]])
    
    sizeImage = XYZ.shape
    
    XYZ = spim2vec(XYZ)
    RGB = dot(M, XYZ)
    
    RGB = RGB/100.0
    RGB[RGB > 1.0] = 1.0
    RGB[RGB < 0.0] = 0.0
    
    # Applying gamma correction:
    indices = (RGB <= 0.0031308)
    RGB[indices] = 12.92 * RGB[indices]
    indices = ~indices
    RGB[indices] = 1.055 * RGB[indices]**(1.0/2.4) - 0.055
    
    RGB = reshape(RGB.T,(sizeImage[0],sizeImage[1],3))
    
    return RGB


